import React from "react";
import {Card, ProgressBar} from "react-bootstrap";
import "./EnemyIcon.css";

const EnemyIcon = ({ enemy }) => {
  return (
    <Card className='enemy-icon-card'>
      <div className='enemy-icon-container'>
        <div className="username">BrianMinhNguyen</div>
        <div className="text">50 hp</div>
        <ProgressBar>
          <ProgressBar variant="success" striped now={80}/>
        </ProgressBar>
      </div>
    </Card>
  );
};

export default EnemyIcon;
